<p>Under test, we usually have a function that takes an <code>IO</code>, does something and returns an <code>IO</code>. And this something that the function does is what we need to test. Not the output value, unfortunately, but something that happens when the side-effectful program this value describes is executed. This is the first problem we usually face when trying to test functionalities like that.</p>
